import React from 'react'
import './intro.css'

const Intro = () => {
  return (
    <section id="intro">
        <div className="intoText">  
            <span classname="hello">Hello</span>  
            <span className='text'>I am Gouri</span>       
        </div>
    </section>
  )
}

export default Intro
